import React from 'react';
import './ResultItem.css';
import DefaultIMg from '../../assets/images/locations/Applenook_NoImage.jpg';


const resultItem = (props) => {
  return (
    <div className="resultItem--container">
    <img src={DefaultIMg} className="resultItem--image" alt={'Image showing location around ' + props.location.WaypointName}/>
    <span>{props.location.ImageName}</span>
    <div className="resultItem--content">
    <div>
      <div className="resultItem--content-Waypointicon"></div>
      <div className="resultItem--content-WaypointInfo">
        <strong>{props.location.WaypointName}</strong>
        <span>{props.location.WaypointCode}</span>
      </div>
    </div>

    </div>
    </div>

  );
}


export default resultItem;
